import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import '../container.css';
export default function UploadSchedule() {

  // Dummy schedule data (replace with your actual data source)
  const initialSchedule = {
    // Replace with actual schedule data structure (e.g., object with days and timeslots)
    monday: {
      '9:00 AM': true, // Green cell (available)
      '10:00 AM': false,
      '11:00 AM': false, // Grey cell (unavailable)
    },
    tuesday: {

      // ...
    },
    // ...
  };

  // State for schedule data
  const [schedule, setSchedule] = useState(initialSchedule);

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability)
  const handleCellClick = (day, time) => {
    setSchedule((prevSchedule) => ({
      ...prevSchedule,
      [day]: {
        ...prevSchedule[day],
        [time]: !prevSchedule[day][time],
      },
    }));
  };

  // Function to generate empty schedule (for upload mode)
  const generateEmptySchedule = () => {
    const days = ['monday', 'tuesday', 'wednesday', 'thursday', 'friday'];
    const timeslots = ['9:00 AM', '10:00 AM', '11:00 AM', '12:00 PM','01:00 PM','02:00 PM','03:00 PM','04:00 PM','05:00 PM','06:00 PM','07:00 PM','08:00 PM','09:00 PM','10:00 PM'];

    return days.reduce((acc, day) => {
      acc[day] = timeslots.reduce((acc2, time) => {
        acc2[time] = false; // All cells grey (unavailable) in upload mode
        return acc2;
      }, {});
      return acc;
    }, {});
  };
  const particlesRef = useRef(null);

  const handleHover = () => {
    if (particlesRef.current) {
      particlesRef.current.setConfig({
        // Change animation properties here (e.g., color, size, density)
        particles: {
          color: { value: ['#f9c79e', '#95e1a5', '#a78bfa'] }, // Multicolor variation
        },
      });
    }
  };

  const handleUpload = () => {
    setSchedule(generateEmptySchedule()); // Reset schedule to empty for upload
    setIsEditing(true); // Enable editing mode for upload
  };

  // Function to simulate saving the schedule (replace with actual logic)
  const handleSubmit = async () => {
    alert('Saving schedule...');

    // Replace with your actual saving logic (e.g., API call)
    // This example simulates a successful save after 2 seconds
    await new Promise((resolve) => setTimeout(resolve, 2000));

    setIsEditing(false); // Reset edit mode after successful save
  };

  return (
    <div className="container mt-4 animated-background" style={{ marginLeft: '250px', marginTop: '56px' }}>
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={{
          fpsLimit: 60,
          particles: {
            number: {
              value: 80,
              density: {
                enable: true,
                value_area: 800,
              },
            },
            color: { value: '#fff' }, // Adjust this for initial color
            shape: {
              type: 'circle',
              stroke: {
                width: 0,
                color: '#000',
              },
            },
            links: {
              enable: true,
              distance: 150,
              color: '#fff',
              opacity: 0.4,
            },
            move: {
              enable: true,
              speed: 6,
              direction: 'none',
              random: false,
              straight: false,
              outMode: 'bounce',
            },
          },
          interactivity: {
            detectsOn: 'canvas',
            events: {
              hover: {
                enable: true,
                mode: 'bubble',
                distance: 200,
              },
            },
          },
          retina_detect: true,
        }}
        ref={particlesRef}
      />
      <h2>This weeks Schedule</h2>


      <table className="table table-bordered">
        <thead>
          <tr className="table-dark">
            <th></th>
            {Array.from({ length: 14 }, (_, i) => (
              <th key={`time-${i + 9}`}>{i + 9}:00 AM</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {Object.entries(schedule).map(([day, timeslots]) => (
            <tr key={day}>
              <th scope="row" className="table-light">{day}</th>
              {Object.entries(timeslots).map(([time, available]) => (
                <td
                  key={`${day}-${time}`}
                  className={
                    available
                      ? 'table-success bg-success text-white'
                      : 'table-secondary text-muted'
                  }
                  onClick={() => (isEditing ? handleCellClick(day, time) : null)}
                  onMouseEnter={() =>
                    isEditing ? (e) => e.target.classList.add('table-active') : null
                  }
                  onMouseLeave={() =>
                    isEditing ? (e) => e.target.classList.remove('table-active') : null
                  }
                >
                  {isEditing ? '' : available ? 'Available' : ''}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>

      <button type="button" className="btn btn-primary me-2" onClick={handleEdit}>
        {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
      </button>
      <button type="button" className="btn btn-success" onClick={handleUpload}>
        Upload New Schedule
      </button>
      {isEditing && <button type="button" className="btn btn-primary" onClick={handleSubmit}>
        Submit
      </button>}
    </div>
  );
}
